import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import Items from "./components/Items";


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      items: [
        {
          id: 1,
          title: 'Детский гранитур',
          img: 'detgar.jpg',
          price: '13999'
        },
        {
          id: 2,
          title: 'Кровать',
          img: 'krovat1.jpg',
          price: '3499'
        },
        {
          id: 3,
          title: 'Тюль белый',
          img: 'tulWhite.jpg',
          price: '1399'
        },
        {
          id: 4,
          title: 'Стол письменный',
          img: 'stolpism.jpg',
          price: '4999'
        }
      ]
    }
  }

  render() {
    return (
      <div className="wrapper">
        <Header />
        <Items items={this.state.items}/>
        <Footer />
      </div>
    );
  }
}

export default App;
